        "description": "The Veterans Resource Center of the University Student Union invites all Student Veterans and military-connected Matadors to have some fun at our virtualGame Nighton Zoom! On select Thursdays, you can come hang out online with your friends from the VRC to enjoya little competition and conversation playing virtual games together. Plus, each week a $10 Amazon gift card will be given away to the winner of the night! Come kick-back and have a chance to score some prizes while you let the good times roll at virtualGame Night Virtualhosted by the VRC!Participate every week for a change to win our raffle at the end of the semester. One entry per participation, the more you show up the more chances you have to win an Amazon gift card!",
